import Link from 'next/link';

const Nav = () => (
    <div>
        <img src="/static/logo.jpg" alt="logo" height="100" />
        <Link href="/">
            <a>Home Page</a>
        </Link>

        <Link href="/About">
            <a>About Page</a>
        </Link>
        <style>{`
        a, img {
            padding: 10px
        }
        `}</style>
    </div>
);

export default Nav;
